//	||  r  |   r   |     r     |   W   |     r     |    W    |    e    ||
//	||  a  |   e   |     a     |   a   |     e     |    a    |    l    ||
//	||  v  |   a   |     v     |   i   |     a     |    i    |    a    ||
//	||  e  |   k   |     e     |   t   |     k     |    t    |    y    ||
